import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './UserDashboard.jsx'
class Job extends React.Component {
  constructor(){
    super();
  }
  render(){
    const background = {
      //"background-color":'EEF6FE'
      width: "auto",
      height: 2000,
      "background-color": "#eef6fe"
    }
    const box = {
      float:"right",
      width:400,
      height:100,
      "background-color":"white"
    }
    const leftalign = {
      "text-align":"left",
      margin:10
    }
    const rightalign = {
      "text-align":"right",
      margin:10
    }

    const list = {
      position: "absolute",
      top: 140

    }
    return(
      <body style ={background}>
        <div style ={box}>
          <div style={{float:"left"}}>
            <h1 style={leftalign}>Job title</h1>
            <h2 style={leftalign}>Company</h2>
            <h2 style={leftalign}>City</h2>
          </div>
          <div style={{float:"right"}}>
            <h1 style={rightalign}>2015-Present</h1>
            <h2 style={rightalign}>38 hrs per week</h2>
            <h2 style={rightalign}>$90k per year</h2>
          </div>
          <ul style = {list}>
            <li>Determines operational feasability by evaluating analysis, problem definition, requirements, solution development, and proposed solutions.</li>
            <li>Documents and demonstrates solutions by devloping documentation, flowcharts, layouts, diagrams, charts, code comments and clear code.</li>
            <li>Prepares and installs solutions by determining and designing system specifications, standards, and programming.</li>
          </ul>
        </div>
      </body>
      //<h2>{this.props.company_name}</h2>
    )
  }
}

export default Job;
